(1, 1, 'uploads/leader/16.png', 'uploads/leader/Farzana_image5.jpeg', 'Farzana Dohadwala - Executive Chairperson', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 16px; line-height: 29px; color: rgb(105, 103, 103); font-family: Lato, sans-serif; text-align: justify !important;\">A National and international educator with over 30 years of experience has established over 20+ schools and has mentored over 100 Schools across India, Middle East and South Asia. A change maker, pioneering new approaches in education, Madam Farzana Dohadwala is recognized as one of India’s top 50 educationists.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; font-size: 16px; line-height: 29px; color: rgb(105, 103, 103); font-family: Lato, sans-serif; text-align: justify !important;\">She is the Founding member of South Asia IB Schools Association which she started in the year 1992. She is the Vice President of Early Childhood Association and Association of Primary Education and Research. A Member of FICCI Alliance of Re-imaging School Education (ARISE) and one of the founding members of the Association of ICSE Schools in Maharashtra (AISM).</p><blockquote style=\"padding-top: 30px; padding-bottom: 30px; padding-left: 20px; margin-bottom: 20px; font-size: 17.5px; border-left: 0px; font-weight: 700; border-radius: 20px; background: rgb(243, 240, 207); color: rgb(105, 103, 103); font-family: Lato, sans-serif; font-style: normal; letter-spacing: normal; text-align: justify !important;\">&nbsp;Madam Farzana Dohadwala is a strong believer of Plutarch, the Greek philosopher‘s thought which is “The mind is not a vessel to be filled but a fire to be ignited “</blockquote>', '2021-05-24 08:01:14', 'Active'),
(2, 2, 'uploads/leader/2.png', 'uploads/leader/Ankita_Image.jpg', 'Ankita Patil Lunkad - Managing Trustee', '<p><span style=\"color: rgb(105, 103, 103); font-family: Lato, sans-serif; font-size: 16px; text-align: justify; background-color: rgb(243, 240, 207);\">She devoted her early years as a pre-school teacher and also taught the underserved children at Punya Dham Ashram in Pune. A Dynamic Young Edupreneur with a Master’s Degree in International Business from Kings College, United Kingdom Ankita Patil Lunkad has always had a strong belief and values in creating impacts on the lives of young children in the country,..</span><br></p>', '2021-05-25 04:14:42', 'Active');
INSERT INTO `tbl_our_approach` (`id`, `content`, `create_date`, `status`) VALUES
(2, '<p><div class=\"row features\" style=\"box-sizing: border-box; margin: 40px 0px;\"><div class=\"col-lg-12 col-sm-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-right: 15px; padding-left: 15px; float: left; width: 1140px;\"><div class=\"col-md-4 media text-center\" style=\"box-sizing: border-box; text-align: center; position: relative; min-height: 1px; padding-right: 15px; padding-left: 15px; float: left; width: 370px; margin-top: 0px; overflow: hidden; zoom: 1;\"><i class=\"flaticon-alphabet\" style=\"box-sizing: border-box; transition: all 0.2s ease-in-out 0s; font-size: 90px; margin: 20px; padding: 10px; vertical-align: middle; color: rgb(209, 40, 129); font-family: Lato, sans-serif; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></i><span style=\"color: rgb(105, 103, 103); font-family: Lato, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"></span><div class=\"media-body\" style=\"box-sizing: border-box; overflow: hidden; zoom: 1; width: 10000px; display: table-cell; vertical-align: top; color: rgb(105, 103, 103); font-family: Lato, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;\"></div></div></div></div></p><div class=\"row\" style=\"box-sizing: border-box; margin-right: -15px; margin-left: -15px;\"><div class=\"col-lg-12 col-sm-12\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-right: 15px; padding-left: 15px; float: left; width: 1170px;\"><p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; line-height: 29px; text-align: justify !important;\">At Tic Tac Toe our early years centre we aim for a high HQ (Happiness Quotient) as a happy child will enjoy his /her learning journey and become future ready for the next learning milestones.</p><p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; line-height: 29px; text-align: justify !important;\">Our pedagogy is inspired by Bijubhai Badheka, Maria Montessori, Reggio Emelia and Froebel. It is learner centred and inquiry driven where we nurture the potential of every child.</p><p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; line-height: 29px; text-align: justify !important;\">Our young learners use creative play to communicate their feelings which is so important. During creative play our young learners experience, discover, experiment and create things which ignite their curiosity and are the first steps into discovery learning.</p><p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; line-height: 29px; text-align: justify !important;\">Music and Physical Movement is an integral part of our daily timetable. We use children’s natural tendency to play which includes free play or unstructured play along with structured play which is learner centred.</p><p style=\"box-sizing: border-box; margin: 0px 0px 10px; font-size: 16px; line-height: 29px; text-align: justify !important;\">Interacting with friends at Tic Tac Toe gives our learners the chance to establish connections, note how others react to their actions and find solutions to overcome challenges together; all valuable skills that they will need in their future</p></div></div>', '2021-05-21 08:14:10', 'Active');
INSERT INTO `tbl_our_approach_icons` (`id`, `title_id`, `icon_image`, `title`, `text_icon`, `created_date`, `status`) VALUES
(1, 1, 'flaticon-alphabet', 'Creative Play', 'Teaching and Learning in Early Years should be Play based as Carl Jung has said “The creation of something new is not accomplished by the intellect but by the play instinct.”', '2021-05-24 05:16:27', 'Active'),
(2, 3, 'flaticon-game', 'Physical Activity', 'It is an important and integral part of our active playtime and daily timetable. Playing on a jungle gym, jumping, climbing helps strengthen their muscles.', '2021-05-24 05:17:39', 'Active'),
(3, 4, 'flaticon-two', 'Friendship & Social Interactions', 'Positive social interactions are beneficial for young learners including increased cognitive ability, communication skills and independence.', '2021-05-24 05:18:46', 'Active'),
(4, 5, 'flaticon-hat', 'Confident Learners', '“I can surely do this” We provide an environment to encourage children to go one step higher on their personal confidence ladder which builds self-esteem makes them independent and self-reliant.', '2021-05-24 05:20:33', 'Active'),
(5, 6, 'flaticon-person', 'Teaching and Learning', 'We balance between play-based learning with educator-guided experiences for each child’s holistic development. Music and Movement is an integral part of our daily timetable.', '2021-05-24 05:21:06', 'Active'),
(7, 7, 'flaticon-music', 'Communication Skills', 'We plan learning engagements using story-telling and field trips to nurture values, literacy, numeracy and respect for the environment', '2021-05-24 06:49:37', 'Active');
